C'est maintenant l'hiver de notre mécontentement
Été glorieux par ce soleil d'York ;
Et tous les nuages ​​qui pesaient sur notre maison
Au sein profond de l'océan enfoui.
Nos fronts sont maintenant liés par des couronnes victorieuses ;
Nos bras meurtris raccrochaient pour des monuments ;
Nos alarmes sévères se sont changées en joyeuses réunions,
Nos affreuses marches vers des mesures délicieuses.
La guerre au visage sinistre a lissé son front ridé ;
Et maintenant, au lieu de monter des coursiers bardés
Pour effrayer les âmes des adversaires redoutables,
Il gambade agilement dans la chambre d'une dame
Au plaisir lascif d'un luth.
Mais moi, qui ne suis pas taillé pour les tricks sportifs,
Ni fait pour courtiser un miroir amoureux;
moi qui suis grossièrement tamponné et je veux la majesté de l'amour
Se pavaner devant une nymphe dévergondée ;
Moi, qui suis réduit de cette juste proportion,
